  [],\n\t\"revision_timestamp\": \"2015-09-26T20:26:10.012418\",\n\t\"name\": \"us-environmental-protection-agency-national-coastal-assessment-for-american-samoa-2004-water-qu\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 2004, the Environmental Protection Agency
  (EPA) Environmental Monitoring and Assessment Program (EMAP) National Coastal Assessment
  (NCA), coordinated through the Gulf Ecology Division, conducted a comprehensive
  survey of the condition of estuarine resources in American Samoa. The survey sampled
  49 stations on islands of Tutuila, Aunu'u Ofu, Olosega, Ta'u during April and August,
  2004. The WATER QUALITY MEASUREMENTS data set contains two types of data: hydrologic
  profile water quality information resulting from in-field observations of physical
  data and water quality information resulting from laboratory examination of water
  quality samples for nutrient analyses. The SEDIMENT CHEMISTRY data set contains
  sediment contaminant information resulting from laboratory examination of samples
  collected at sites. Each record reports the contaminant name and its associated
  measured concentration, date site was visited, and the group that collected the
  data. Only one grab per site was required by the program.The SEDIMENT GRAIN data
  set contains sediment grain analyses information resulting from laboratory examination
  of samples collected at sites visited during probability surveys. Each record reports
  the sediment component and its associated measured concentration, date site was
  visited, and the group that collected the data. Only one grab per site was required
  by the program.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
